import React from "react";
import '../App.css'
import { Link } from 'react-router-dom'
import { FaSearch, FaInfoCircle, FaSignInAlt } from 'react-icons/fa';

class Navigation extends React.Component {
  render() {
    return (
      <nav className="flex jcsb bgBlue  fixed" style={{ padding: "15px", left: 0, right: 0 }}>

<div className="flex w50"></div>
        <div className="flex jcsb w50">
          <Link className="nav" to='/'><FaSearch /></Link>
          <Link className="nav" to='/about'><FaInfoCircle /></Link>
          <Link className="nav" to='/firebaselogin'><FaSignInAlt /></Link>
        </div>
      </nav>

    );
  }
}


export default Navigation;
